import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import toggle from "./toggle-icon.png"
function Test() {
    const openNav = () => {
        document.getElementById('mySidenav').style.width = "250px"
    }
    const closeNav = () => {
        document.getElementById("mySidenav").style.width = "0"
    }
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    const [isOpen, setIsOpen] = useState(false);

    const toggleOffcanvas = () => {
        setIsOpen(!isOpen);
    };
    // const styleButton = 

    return (
        <React.Fragment>
            <div id="mySidenav" className="sidenav">
                <a href="#" className="closebtn" onClick={handleClose}>&times;</a>
                <Link to="/"> Home</Link>
                <Link to="fashion"> Fashion</Link>
                <Link to="electronic"> Electronic</Link>
                <Link to="jewellery"> Jewellery</Link>
            </div>
            <span className="toggle_icon" onClick={handleShow}>
                <button>
                    <img src={toggle} alt="toggle" />
                </button>
            </span>

            <div className={`offcanvas ${isOpen ? 'open' : ''}`}>
                <div className="offcanvas-toggle" onClick={toggleOffcanvas}>
                <button>
                    <img src={toggle} alt="toggle" />
                </button>
                </div>
                <div className="offcanvas-content">
                  heelo
                </div>
            </div>





        </React.Fragment>
    )
}

export default Test
